webpackJsonp([93410128664779],{2808:function(e,t){e.exports={pathContext:{docHtml:'<h1>Contributing</h1>\n<p>This repository uses <a href="https://cr.joyent.us">cr.joyent.us</a> (Gerrit) for new\nchanges.  Anyone can submit changes.  To get started, see the <a href="https://github.com/joyent/joyent-gerrit/blob/master/docs/user/README.md">cr.joyent.us user\nguide</a>.\nThis repo does not use GitHub pull requests.</p>\n<p>See the <a href="https://github.com/joyent/eng/blob/master/docs/index.md">Joyent Engineering\nGuidelines</a> for general\nbest practices expected in this repository.</p>\n<p>Contributions should be "make prepush" clean.  The "prepush" target runs the\n"check" target, which requires these separate tools:</p>\n<ul>\n<li><a href="https://github.com/davepacheco/jsstyle">https://github.com/davepacheco/jsstyle</a></li>\n<li><a href="https://github.com/davepacheco/javascriptlint">https://github.com/davepacheco/javascriptlint</a></li>\n</ul>\n<p>If you\'re changing something non-trivial or user-facing, you may want to submit\nan issue first.</p>',docPath:"argo-ci/node_modules/jsprim/contributing",proj:"argo-ci"}}}});
